import React from "react";

import bgImg from "../3_images/1_home/bg_home.jpg";
import bgLogo from "../3_images/1_home/icon_home.png";

import Line from "../0_components/Line";

import { HomeStyles } from "../2_styles/1_layout/HomeStyles.js";

export default function Home() {
  return (
    <div className="main_box">
      <HomeStyles bgImg={bgImg} bgLogo={bgLogo}>
        <div className="bg_img"></div>
        <div className="bg_logo"></div>
        <div className="title">
          <p>the</p>
          <p>avengers</p>
          <Line />
        </div>
      </HomeStyles>
    </div>
  );
}
